/*eslint-disable*/
import React from "react";
import { motion } from "framer-motion";

// reactstrap components

// core components

function PresentationHeader() {
  return (
    <>
      <div className="page-header clear-filter">
        <div className="rellax-header rellax-header-sky" data-rellax-speed="-4">
          <div
            className="page-header-image"
            style={{
              backgroundImage:
                "url(" +
                require("assets/img/presentation-page/nuk-pro-back-sky.jpg") +
                ")",
            }}
          ></div>
        </div>

        <div
          className="rellax-header"
          data-rellax-speed="0"
        >

          <div
            className="page-header-image"

            style={{
              backgroundImage:
                "url(" +
                require("assets/img/work1.jpg") +
                ")",
            }}
          ></div>
        </div>
        <div className="rellax-text-container rellax-text"
        >


                          <h4 className="h3-description rellax-text" data-rellax-speed="-1">
                          <motion.div whileHover={{ scale: 1.1, duration: 200000000000000 }} >
                          <a className="category text-warning">  Serving Manatee, Sarasota, Hillsborough, Polk, Charlotte, Citrus, DeSoto and Hardee counties.</a>
                        </motion.div>  </h4>  </div>
      </div>
    </>
  );
}

export default PresentationHeader;
